import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react';

class Map extends Component {
  constructor(props) {
    super(props)
    this.state = {
      center: {
        lat: 32.7096422,    //default downtown San Diego
        lng: -117.1579546
      },
      zoom: 11,
    }
  }

  render() {
    return (
      <div style={{ height: '45vh', width: '35vw', margin: '10vh auto' }}>
        <GoogleMapReact
          bootstrapURLKeys={{ key: 'AIzaSyDPJJChG0F7S36LTQrSy00ZwwDIZdVeghw' }}
          center={this.state.center}
          zoom={this.state.zoom}>
        </GoogleMapReact>
      </div>
    );
  }
}

export default Map;
